<?php
$db = __DIR__ . DIRECTORY_SEPARATOR . str_replace('.php','.json',basename(__FILE__));
if (isset($_GET['load'])) {
	echo file_get_contents($db);
	exit;
}
if (isset($_GET['save'])) {
	if (isset($_POST['date']) && isset($_POST['value'])) {
		$date = json_decode($_POST['date']);
		$value = json_decode($_POST['value']);
		$data = json_decode(file_get_contents($db));
		$data->$date = $value;
		file_put_contents($db, json_encode($data));
		echo "true";
	}
	else { echo "false"; }
	exit;
}
?><!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8" />
<meta name="viewport" content="width=device-width, initial-scale=1.0" />
<title>TimeTracker2</title>

<style>
@font-face {
	font-family: MorePerfectDOSVGA;
	src: url(data:application/octet-stream;base64,) format("truetype");
	font-weight: 400;
	font-style: normal;
