<script>
function dbDate() {
	var d = new Date();
	return d.getFullYear()+'-'+('0'+(d.getMonth()+1)).slice(-2)+'-'+('0'+d.getDate()).slice(-2)+' '+('0'+d.getHours()).slice(-2)+':'+('0'+d.getMinutes()).slice(-2);
}
function dbTimestamp() {
	return Math.floor(Date.now() / 1000);
}

var timestamp = dbTimestamp();
var saved = timestamp;
var date = null;
var time = 0;
var total = 0;
var saveInterval = 3;
var started = false;

function save() {
	var xhr = new XMLHttpRequest();
	xhr.onreadystatechange = function(data) {
		if (xhr.readyState == 4) {
			if (xhr.status == 200 || xhr.status == 206) {
				if (xhr.response === false) {
					alert('Error saving.');
				}
				else {
					saved = dbTimestamp();
				}
			}
		}
	};
	var url = new URL(location.href);
	url.searchParams.set('save', '');
	xhr.open('POST', url.toString().replace(/\=$/,''));
	xhr.setRequestHeader('X-Requested-With', 'XMLHttpRequest');
	xhr.setRequestHeader('Content-type', 'application/x-www-form-urlencoded');
	xhr.responseType = 'json';
	let value = {};
	value[current.textContent] = time;
	xhr.send('date='+JSON.stringify(date)+'&value='+JSON.stringify(value));
}

document.addEventListener("DOMContentLoaded", function() {
	document.addEventListener("keydown", function(e) {
		if (e.ctrlKey === true) { return; }

		if (e.code === 'Enter') {
			if (date !== dbDate()) {
				date = dbDate();
				time = 0;
				elapsed.textContent = (time / 60 / 100).toFixed(2);
			}
			current.textContent = entry.textContent;
			entry.textContent = '';
			save();

			if (!started) {
				started = true;

				setInterval(function() {
					var ts = dbTimestamp();
					if (timestamp !== ts) {
						timestamp = ts;
						time += 1;
						total += 1;
						elapsed.textContent = (time / 60 / 100).toFixed(2);
						elapsed2.textContent = (total / 60 / 100).toFixed(2);
					}

					if ((ts - saved) >= saveInterval) {
						save();
					}
				}, 500);
			}
		}
		else if (e.code === 'Backspace') {
			entry.textContent = entry.textContent.substr(0, entry.textContent.length-1);
		}
		else if (e.shiftKey == false && (e.keyCode >= 48 && e.keyCode <= 57) || (e.keyCode >= 65 && e.keyCode <= 90)) {
			if (entry.textContent.length < 8) {
				entry.textContent += e.key.toUpperCase();
			}
		}
	});

});
</script>

</head>
<body id="app" class="darkmode">
<div id="entry"></div>
<div id="current">IDLE</div>
<div id="elapsed">0.00</div>
<div id="elapsed2" style="margin-top:0.5em; opacity:0.1">0.00</div>
</body>
</html>
